	public static int[][] createRandom(){
		int[][] temp = new int[60][80];
		Random random = new Random();
		
		
		for (int i = 0; i < temp.length; i++) {
			for (int j = 0; j < temp[i].length; j++) {
				int randomInt = random.nextInt(100);
				if (randomInt > 65) {
					temp[i][j] = 1;
				}else {
					temp[i][j] = 0;
				}
			}
		}
		
		return temp;
	}
			
			
